import { useLocation } from "react-router-dom";
import Axios from "axios";

import r from "./Review.module.css";

function Review() {
const location = useLocation();
const book  = location.state.book;
const num = book.stars;
const stars = num.toString() + ".png";

const image = () => {
if(book.filename == null || book.filename == "") {
   <img src={`http://localhost:3001/unknown.jpg`} />
} else {
<img src={`http://localhost:3001/${book.filename}`} />
}
}





  return (
    <div className={r.margin}>
      <div>
        <p>{book.title}</p>
      </div>
      <div>
        <p>{book.author}</p>
      </div>
      <div>
        <p>{book.review}</p>
      </div>
      <div>
        <p>{book.date}</p>
      </div>
      <div>
        <img src={`http://localhost:3001/${stars}`} />
      </div>
      <div>
      {image}
      </div>
    </div>
  );
}

export default Review;
